/* AUTHOR */
#communication-banner {
    background: #4ca5d1;
    color: #fff;
    border-bottom: solid HSL(216, 14%, 15%) 6px;
}

div#site-wrapper {
    background-color: HSL(216, 14%, 19%);
}

h3 {
    color: HSL(216, 14%, 60%);
}

body {
    color: HSL(216, 14%, 75%);
}

.blog-date .blog-date-day {
    color: HSL(216, 14%, 60%);
}
.blog-date .blog-date-month {
    color: HSL(216, 14%, 60%);
}

.custom-widget-toolbox h3 {
    color: HSL(216, 14%, 60%);
}
.custom-sidebar h3 {
    color: HSL(216, 14%, 60%);
}

input[type="text"].hs-search-field__input {
    border-top-right-radius: 0;
    border-bottom-right-radius: 0;
}
.inputAndButton button {
    background-color: hsl(216,14%,60%);
    border: 1px solid hsl(216,14%,75%);
    border-left: 0;
}

.custom-top-footer {
    background-color: hsl(216,14%,19%);
    border-top: solid hsl(216,14%,15%) 0;
}

/* ESQUISSE */
dl.frontmatter-panel {
    background-color: HSL(218, 14%, 26%);
    box-shadow: hsl(216, 14%, 15%) 0px 0px 14px 0px inset;
}

/* BLOG POST */
.custom-post-inner-wrapper {
    background-color: HSL(216, 14%, 15%);
}

.post-header-info {
    background: HSL(216, 14%, 15%);
}

.post-header-info .infos {
    color: HSL(216, 14%, 60%);
}

.post-header-info .post-date-day {
    color: HSL(216, 14%, 60%);
}

.hs-blog-post .blog-content {
    background-color: HSL(216, 14%, 19%);
    color: hsl(216, 14%, 90%);
}

.post-body blockquote {
    color: HSL(216, 14%, 60%);
}
.post-body blockquote>:last-child {
  background:url(/hubfs/Assets/guillemet-bas.png) no-repeat right bottom;
}

.post-body pre {
    background: HSL(216, 14%, 26%);
    box-shadow: 5rem 0 HSL(216, 14%, 26%),-5rem 0 HSL(216, 14%, 26%);
}

.post-body code {
    color: HSL(216, 14%, 75%);
    background-color: HSL(216, 14%, 26%);
}

.post-body hr {
    background-color: hsl(216, 14%, 60%);
}

.post-body p:last-of-type {
    color: hsl(216, 14%, 60%);
}

.sharing-button {
    color: #fff;
    background: HSL(216, 14%, 26%);
}

.blog-pagination {
    background-color: HSL(216, 14%, 26%);
}

.blog-pagination a.next-posts-link {
    border-left: 1px solid HSL(216, 14%, 26%);
}

.blog-pagination a.previous-posts-link {
    border-right: 1px solid HSL(216, 14%, 26%);
}

.related-post {
    background: HSL(216, 14%, 26%);
    border-bottom: 1px solid HSL(216, 14%, 15%);
}

.custom-inner-article:hover {
    background: HSL(216, 14%, 15%);
}

#comments-listing {
    border: 1px solid HSL(216, 14%, 15%);
}

input[type="text"], input[type="password"], input[type="datetime"], input[type="datetime-local"], input[type="date"], input[type="month"], input[type="time"], input[type="week"], input[type="number"], input[type="email"], input[type="url"], input[type="search"], input[type="tel"], input[type="color"], input[type="file"], textarea, select {
    background-color: hsl(216, 14%, 15%);
    border: 1px solid hsl(216, 14%, 60%);
    color: HSL(216, 14%, 60%);
}

.hs-form-field > label, label.hs-form-booleancheckbox-display {
    color: HSL(216, 14%, 60%);
}

form.hs-form .hs-form-field ul.hs-error-msgs.inputs-list {
    color: HSL(359, 45%, 60%);
}

.footer-container-wrapper {
    border-top: 8px solid HSL(216, 14%, 15%);
}

